  return (
    <div className="wrapper">
      <div className="container">
        <main className="main">
        <Navigation />
        <Tracks />
        <Recom />
        </main>
         <BarAudioPlayer />
        <footer className="footer"></footer>
      </div>
    </div>
  );
}

export default App;
